                <Link to="/4/123" style={{ marginLeft: "20px" }}>點我連到第四頁</Link>
            </nav> */}
            <h1 style={{ color: "white", fontFamily: "Microsoft JhengHei" }}>我是第二頁</h1>
        </div>
    )
}

